export default function WorkBar(props) {
    const colors = ['white', 'red', 'green', 'blue', 'black', 'gray'];
    
    const colorsBtns = colors.map(data => (<button onClick={() => props.setCurrentColor(data)}>{data}</button>))

    return (
        <div className="App">
            <p>{props.currentColor}</p>
            <span><div style={{backgroundColor: `${props.currentColor}`, width:'100px', height:'100px', borderStyle:'solid' ,borderColor:"black", borderWidth:'1px'}}></div></span>
            <br></br> 
            <div>{colorsBtns}</div>
            <div><input placeholder="another color" style={{width:'100px'}}></input></div>
